    false,nt"url": null,nt"notes": "TASK NAME: NOAA OCM Tift and Cook Counties
    GA Lidar Data Acquisition and Processing Production Task NOAA Contract No. EA133C-11-CQ-0010
    Woolpert Order No. 75271 CONTRACTOR: Woolpert, Inc. This data set is comprised of
    lidar point cloud data, raster DEM, hydrologic 3-d breaklines, flightline vectors,
    survey control, project tile index, and project data extent. This task order requires
    lidar data to be acquired over the Tift and Cook Counties, GA area of interest (AOI),
    and will be acquired as part of this task order. The total area of the Tift and
    Cook Counties, GA AOI is approximately 515 square miles. The lidar data acquisition
    parameters for this mission are detailed in the lidar processing report for this
    task order. The lidar data will be acquired and processed under the requirements
    identified in this task order. Lidar data is a remotely sensed high resolution elevation
    data collected by an airborne platform. The lidar sensor uses a combination of laser
    range finding, GPS positioning, and inertial measurement technologies. The lidar
    systems collect data point clouds that are used to produce highly detailed Digital
    Elevation Models (DEMs) of the earth's terrain, man-made structures, and vegetation.
    The task required the LiDAR data to be collected at a nominal pulse spacing (NPS)
    of 0.7 meters. The final products include classified LAS, four (4) foot pixel raster
    DEMs of the bare-earth surface ESRI Grid Format. Each LAS file contains lidar point
    information, which has been calibrated, controlled, and classified. Additional deliverables
    include hydrologic breakline data, flightline vectors, control data, tile index,
    lidar processing and survey reports in PDF format, FGDC metadata files for each
    data deliverable in .xml format. Ground conditions: Water at normal levels; no unusual
    inundation; no snow.",nt"license_title": null,nt"extras": [{ntt"key":
